import React from 'react';
import ProductGridItem from "../product-grid-item/product-grid-item";
import './product-grid.scss'
import {addToCart} from "../../redux/cart/cart.utils";

const ProductGrid = ({products}) => {
    if (products){
        console.log(addToCart(products,products[4]))
    }
    return (
        <div className={`product-grid`}>
            {
                products ?
                    products.map((product, i) => {
                        const {image, price, name} = product;
                        return <ProductGridItem key={i} image={image} price={price} name={name} />
                    }) : null
            }


        </div>
    );
};

export default ProductGrid;
